import React, { Component } from 'react';
import Layout from './../../components/Layout/Layout';
import styles from './explore.module.css';

class Explore extends Component {
    render() {
        return (
            <Layout>
                <div>
                Explore!!!
                </div>
            </Layout>
        );
    }
}

export default Explore;
